export class KnownExtendedPropertyInfo {

    public CanonicalNames: string;

    public AlternateNames: string;

    public Areas: string;

    public References: string;

    public constructor(canonicalNames: string, alternateNames: string, areas: string, references: string) {
        this.CanonicalNames = canonicalNames;
        this.AlternateNames = alternateNames;
        this.Areas = areas;
        this.References = references;
    }

    public /* override */ ToString(): string {
        return this.CanonicalNames;
    }
}

