    public GetAllPropertyDefinitions(): ExtendedPropertyDefinition[] {
        //  Initialize list on first use.
        if ((this.PropertyDictionary.Count == 0)) {
            this.InitializeList();
        }

        let properties: ExtendedPropertyDefinition[] = new Array(this.PropertyDictionary.Count);
        this.PropertyDictionary.Keys.CopyTo(properties, 0);
        return properties;
    }

